import Graph from "./Graph";

const Tree = (props) => {
  if (props.show == "Graph") {
    return (
      <Graph
        address={props.address}
        tree={props.tree}
        triggerFetch={props.triggerFetch}
      />
    );
  }
};

export default Tree;
